import React, { Component } from "react";

export default class Toggle extends Component {
  constructor(props) {
    super(props);

    this.state = {
      on: true,
    };
  }
  handleClick = () => {
    this.setState({ on: !this.state.on });
  };
  render() {
    return <div>Toggle</div>;
  }
}
